import React from "react";
import { cn } from "@/lib/utils";

/**
 * Creates an Icon component with automatic className handling.
 *
 * @param {React.ReactElement} SvgElement - The SVG element to be wrapped.
 * @returns {React.FC<React.SVGProps<SVGSVGElement>>} A new Icon component.
 */
export function createIcon(
  SvgElement: React.ReactElement,
  useDefaultClassName = true,
): React.FC<React.SVGProps<SVGSVGElement>> {
  const Icon = React.forwardRef<SVGSVGElement, React.SVGProps<SVGSVGElement>>(
    ({ className, ...props }, ref) => {
      return React.cloneElement(SvgElement, {
        ref,
        className: cn(useDefaultClassName ? "h-4 w-4 " + className : className),
        ...props,
      });
    },
  );

  Icon.displayName = `Icon(${SvgElement.type.name || "Anonymous"})`;

  return Icon;
}

